import { initAuth0 } from '@auth0/nextjs-auth0'
//daados da tela de integração do auth0 para nossa aplicação.

export default initAuth0({
    clientID: "k04DTtG7RDkAS63ytwa39SQYTzNz2aBe",
    clientSecret:'1GIfaClISmk2SV45vz-Vu3LBEO1OLT6puiYt3CYkjW2xni_FZj5HO9hqEDUsHkB9',
    scope:'user',
    domain:'dev--twep4za.auth0.com', //no cadastro
    redirectUri: 'http://localhost:3000/api/callback',
    postLogoutRedirectUri: 'http://localhost:3000',
    session: {
        cookieSecret:'abababababababababababababababab',//32 caracter
